import React from "react";
import Link from "../../Common/Link";
import "./style.scss";

const Featured01 = ({}) => (
  <div className="card card-custom featured-01 col-sm-4 col-12">
    <a href="#">
      <div className="card-body">
        <h3 className="card-title">
        STI Forum 2019
        </h3>
        <Link>Read More</Link>
      </div>
    </a>
  </div>
);

export default Featured01;
